<script>

function filterItems() {

    setTimeout(() => {
  // 1. Get the value from the search input and convert it to lowercase
  const input = document.getElementById('searchInput');
  const filter = input.value.toLowerCase(); 

  // 2. Get all the parent div elements that contain the items
  const items = document.getElementById('itemList').getElementsByClassName('item');
  // 

  // 3. Loop through all the item divs
  for (let i = 0; i < items.length; i++) {
    // Get the text content of the current item div
    const itemContent = items[i].textContent.toLowerCase();
    
    // Check if the item's content includes the search filter text
    if (itemContent.includes(filter)) {
      // If it matches, make sure the parent div is visible
      items[i].classList.remove('hidden');
    } else {
      // If it doesn't match, hide the parent div
      items[i].classList.add('hidden');
    }
  }
    
    alert('connected');
    }, 1500);
}



</script>


